import React from "react";
import * as ReactDomClient from "react-dom/client";
import App from "./App";
import Profile from "./Profile";
import "./styles/style.css";

const main = ReactDomClient.createRoot(document.querySelector(".benefit"));
const profile = ReactDomClient.createRoot(document.querySelector(".profile"));
main.render(<App />);
profile.render(<Profile />);
